import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    NavLink,
  } from "react-router-dom";

 import SignIn from './SignIn'

class FullPageIntroWithFixedNavbar extends React.Component {
    render(){
        return (
          <BrowserRouter>
          <div>
          {<FullPageIntroWithFixedNavbar></FullPageIntroWithFixedNavbar> }
             <Switch>
              <Route path='/Home' exact component={FullPageIntroWithFixedNavbar }></Route>
                <Route path='/SighIn' exact component={SignIn}></Route>
                 {/* <Route path='/ShowProductsByCategory/:categorie' exact component={ShowProductsByCategory} ></Route>   */}
              </Switch>    
          </div>
          </BrowserRouter>
        );
      }}
      
//   constructor(props) {
//     super(props);
//     this.state = {
//       collapse: false,
//       isWideEnough: false
//     };
//     this.onClick = this.onClick.bind(this);
//   }

//   onClick() {
